import React from "react";
import img from "../src/images"


function Home() {
  return (

    <div class="container">
    <div class="row">
    <div class="col-md-4 col-lg-4">
    <h1 className="heading-home home">Uber <span className="heading-eats heading-home">Eats</span></h1>
    </div>

    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-primary home">Customer Login</button>
    </div>
    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-primary home">Restuarant Login</button>
    </div>
    </div>
    </div>
  );
}

export default Home;
